■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>庫内スペースを有効に使えるフラットタイプ!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5312/1011609-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="399" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5312/1011609-02.jpg"><br><font size="3">庫内はひろびろ使えるフラットタイプ。</font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">よく使用するメニューの自動調理を3種類に抜粋し、更に時間の微調整が可能。庫内はちょっと大きめの18L!</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">よく使用するメニューの自動調理を3種類に抜粋し、更に時間の微調整が可能。庫内はちょっと大きめの18L!</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">本体寸法:約W460×D358×H286mm、庫内寸法:W315×D318×H180mm</font><br><font color="#333333" size="-1">個装サイズ：53×43×34cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約12.4kg</font><br><font color="#333333" size="-1">個装重量：13700g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">本体:鋼板、ドア:PP、スクリーン:強化ガラス</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">電圧周波数:100V　50/60Hz<br>高周波出力:600W強(500W/120W)相当<br>グリル/オーブン:なし<br>総庫内容量:約18L<br>コード長:1.4m<br>庫内灯:100/110V　22W型<br>自動メニュー:3種類<br>タイマー:最大60分(500W使用時)<br>消費電力:1050/1350W</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">取扱説明書<br>保証書(保証期間:1年間)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
